import React, { FC } from 'react';

interface TotalProps {
  parts: {
    name: string;
    exercises: number;
  }[];
}

const Total: FC<TotalProps> = props => {
  return (
    <>
      {props.parts.map((item, index) => {
        <p>Number of exercises {props.total}</p>;
      })}
    </>
  );
};

export default Total;
